// User.js
import React from "react";

const User = ({ planets }) => {
  // Filter rock planets
  const rockPlanets = planets.filter((planet) => planet.isrockplanet);

  // Filter gas planets
  const gasPlanets = planets.filter((planet) => !planet.isrockplanet);

  return (
    <div>
      <h2>Rock Planets:</h2>
      <ul>
        {rockPlanets.map((planet) => (
          <li key={planet.planetname}>{planet.planetname}</li>
        ))}
      </ul>

      <h2>Gas Planets:</h2>
      <ul>
        {gasPlanets.map((planet) => (
          <li key={planet.planetname}>{planet.planetname}</li>
        ))}
      </ul>
    </div>
  );
};

export default User;
